import React from "react";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import NavBar from "./Components/Nav/Nav";

class App extends React.Component{

  state = {
    languages : [
        {   
          lang : "English",
          langFirst: "Turkish",
          langSecond: "English",
          donate : "Donate",
          about : "About",
          contact : "Contact"
        },
        {   
          lang : "Turkish",
          langFirst: "Türkçe",
          langSecond: "İngilizce",
          donate : "Donate",
          about : "About",
          contact : "Contact"
      },
    ],

    language: "English"
}


  render(){
    return(
      <div className="container">
        <NavBar/>
      </div>
    );
  }
}

export default App;
